  [],\n\t\"revision_timestamp\": \"2015-07-23T03:28:09.500172\",\n\t\"name\": \"proposal-for-archeological-testing-and-evaluation-of-the-paradise-point-site-8-fr-71-st-vi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The following proposal addresses a request
  by the Archeological Services Division, National Park Service and the U. S. Fish
  and Wildlife Service for the archeological testing and evaluation of cultural resources
  at the Paradise Point Site 8 Fr 71 on St. Vincent National Wildlife Refuge, Franklin
  County, Florida. Work performed will follow Federal guidelines concerning nonrenewable
  cultural resources as codified under Procedures for the Recovery of Scientific,
  Prehistoric, Historic and Archeological Data 36 CFR 66. The research, fieldwork,
  analysis and reporting procedures outlined in this proposal will culminate in a
  cultural resources assessment of the Paradise Point Site. Evaluation of the resources
  in terms of archeological significance detailed under 36 CFR 60.. 6; criteria established
  by the National Register of Historic Places is required due to ongoing destruction
  of the site by natural erosional processes. Research goals will be 1 to provide
  sufficient descriptive data to  permit the definition of site size, boundaries,
  content, and temporal  cultural affiliations of its various components; 2 to provide
  further analytical and interpretive information addressing prehistoric adaptations
  to northwest Florida coastal ecosystems; and 3 to place the site within a regional
  culturalhistorical framework by comparing the material  culture with published data
  from related sites.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
